import React from 'react';
import pokemonList from '../data';
import Pokemon from './Pokemon';
import './Pokedex.css';

const Title = () => (
  <>
    <h1>Pok√©dex</h1>
    <div>
        <ul className='pokedex-container'>
      {pokemonList.map((el) => (
        <Pokemon key={ el.id } pokemon={ el } />
      ))}
    </ul> 
    </div>

  </>
);

const teste = () => console.log(pokemonList);
teste();

export default Title;
